import './App.css';
import Passwords from './components/passwords';

import { useState, useEffect} from 'react';

function App() {

  let [login, updateLogin] = useState(0);
  const [data, setData] = useData([{}]);
  console.log("Are you loggged in?: " + login)
  return (
    <div className="App">
      {login <= 0 ? 
      (login === -1 ? (
          <div>
            <Passwords onLogin={(param) => {
              updateLogin(param);
            }}></Passwords>
            <br/>
            <br/>
            <label>Sorry, your login sucks!</label>
          </div>
      ) : (<Passwords onLogin={(param) => {
        updateLogin(param);
      }}></Passwords>)) 
      :
      <div>

        <div style={{display: "grid", gridTemplateColumns: "1fr 2fr 1fr"}}>
            <div></div>
            <div><h1>FAKYAK HOMEPAGE</h1></div>
            <div>
              <button onClick={() => updateLogin(0)}>LOG OUT</button>
            </div>

        </div>

        <div>

        </div>
        <button onClick={() => {
            useEffect(() =>{
              fetch("/pythonServer").then(
                res => res.json()
              ).then(
                  data => {
                    setData(data)
                    console.log(data)
                  }
              )

            }, [])

        }}>Get Data</button>
        </div>}  
    </div>
  );
}


export default App;
